(63, 'Despues de leido el.documento y dar las observaciones doy mi visto bueno.', 'CRISTIAN ALBERTO GOEZ THERAN', 'Ambiental', '2019-05-09'),
(64, 'Opción de grado especialización ', 'Cristian Felipe Copete Rodriguez', 'Industrial', '2019-05-10'),
(65, 'ADJUNTO PROPUESTA PARA REVISION DEL DIRECTOR', 'ANDRES SEBASTIAN SANCHEZ KASSELA', 'Ambiental', '2019-05-10'),
(66, 'Cordial saludo. Este proyecto busca actualizar el inventario de aves que residen en el campus del Bosque Popular e identificar contaminantes del aire en el cuerpo de las aves para construir un indicador  como herramienta de investigación', 'ANDRES OTALORA CRISTANCHO', 'Ambiental', '2019-05-13'),
(67, '', 'Maria Camila Garzon Rey', 'Ambiental', '2019-05-13'),
(68, 'Cometi un error a la hora de subir los documentos. El certificado adjunto de finalizacion de materias en realidad es el promedio de Carrera y viceberza.', 'DANIEL JOSE URREGO DUARTE', 'Ambiental', '2019-05-14'),
(69, 'Por error marqué como NO aceptado el trabajo de semilleros titulado \"BIODEGRADACIÓN DE HIDROCARBUROS DE DIFÍCIL DEGRADACIÓN A PARTIR DE MORFOESPECIES FÚNGICAS AISLADAS DE CRUDO ADSORBIDO EN FIBRAS VEGETALES\" y ahora no puedo cambiar el estado del mismo. Quería preguntar si es posible que borren el documento en cuestión para que el estudiante lo pueda subir', 'Patricia J. Pamela Zorro.', 'Ambiental', '2019-05-21'),
(70, 'Buenos dias, adjunto el documento pendiente de compromiso de auxiliar de investigación. \r\nMuchas gracias', 'Maria Camila Garzon Rey', 'Ambiental', '2019-05-22'),
(71, 'cordial saludo ingeniero, he intentado volver a subir el anteproyecto corregido pero no me deja cargar el documento, sin embargo lo envio a su correo, agradezco mucho la atencion prestada', 'Cristian Alexander Gonzalez Arango', 'Sistemas', '2019-05-23'),
(72, 'Buenos días, mi director de proyecto de grado es el ingeniero Ricardo Efren Meza Torres', 'ZULY CAROLINA BARRAG?N ORTIZ', 'Industrial', '2019-05-28'),
(73, 'Buenas tardes : \r\n\r\nAgradezco amablemente si me pueden colaborar con la actualización del correo electrónico de mi usuario debido a que fue asignado al correo de gmail y no al nuevo de office diegoa-peraltac@unilibre.edu.co\r\n\r\nQuedo atento a sus prontos comentarios.', 'Diego Alejandro Peralta Camargo', 'Sistemas', '2019-05-30'),
(74, 'Buen día por medio de este medio solicito el favor retirar de la plataforma la propuesta que subí, no tenia conocimiento que tocaba adjuntar el formato de inscripción de semillero y el certificado de notas en el mismo documento, esto con el fin de que el comite evalue la propuesta. GRACIAS', 'CARLOS JULIAN ARIAS BUITRAGO', 'Ambiental', '2019-05-31'),
(75, 'Buenas tardes.\r\n\r\nSolicito su colaboración con la respuesta a la carta de reactivación de mi proyecto de grado y reasignación de tutor enviada hoy.\r\n\r\nMi usuario y contraseña fueron creados el pasado viernes 31 de mayo.\r\n\r\nAgradezco su atención.', 'DANIEL ANTONIO VELASQUEZ ACOSTA', 'Industrial', '2019-06-04'),
(76, '', 'CARLOS JULIAN ARIAS BUITRAGO', 'Ambiental', '2019-06-05'),
(77, '', 'JORGE MAURICIO DIAZ MELO', 'Industrial', '2019-06-09'),
(78, 'Buenos dias \r\nQuisiera saber cual es El procedimiento para cancelar mi proyecto de grado el cual vencio El pasado 24 de mayo y por temas laborales y familiares no logre terminarlo El proyecto lleva por nombre desarrollo de un sistema de gestion de calidad en la Empresa taxamigo sas .\r\n\r\nMuchas gracias \r\n', 'YOEL ALEXANDER BUSTAMANTE CLAVIJO', 'Industrial', '2019-06-12'),
(79, 'Buenas tardes.\r\n\r\nEn el acta de hoy no aparece mi nombre.\r\n\r\nPor favor me indican qué sucedió?\r\n\r\nGracias.', 'DANIEL ANTONIO VELASQUEZ ACOSTA', 'Industrial', '2019-06-12'),
(80, 'Cordial saludo.\r\nMe ha llegado mail alertando una nueva asignación, pero al revisar las pestañas no encuentro ninguna. Por favor me pueden indicar en donde la puedo revisar?\r\nGracias', 'PILAR DELGADO NI', 'Ambiental', '2019-06-18'),
