(83, 'Al estudiante ya se le informo necesidad de solicitar prorroga.\r\n\r\nAtentamente,', 'Julio Fernando Ochoa Rodr', 'Industrial', '2019-07-08'),
(84, 'se anexa formato via mail del proyecto, evaluado ', 'Sonia Lucila Meneses Velosa', 'Industrial', '2019-07-09'),
