(87, 'Buena tarde, estoy revisando un documento que había registrado previamente y me doy cuenta que tengo un mensaje en donde aparece que se han modificado registros en la plataforma, en efecto, mi documento registrado fue bajado de la plataforma, como consecuencia de ello, no aparezco en las actas emitidas por la facultad, siendo de carácter urgente, dado que la propuesta de grado por la cual opté que', 'ANDRES FELIPE DAVILA MENDOZA', 'Ambiental', '2019-07-15'),
