(114, 'Buenas Tardes, el presente es para hacer un sugerencia con respecto al Poster Cientifico, la bibliografia no la deberíamos incluir, esto con el fin de aprovechar ese espacio para incluir mas resultados, es algo que seria muy bueno y que lo recomiendan los expertos.', 'Hever Andres Pineda pinz?n', 'Sistemas', '2019-08-08'),
