(117, 'Buen día,\r\nLa presente para solicitar la cancelación de este proyecto, pues por motivos de viaje fuera del país de los dueños y venta de la clínica veterinaria a la que iba a ser implementado el CRM, no será posible continuar con esta propuesta. Mi compañero y yo, vamos a realizar un nuevo proyecto, por lo que pasaremos una nueva propuesta. La noticia ya fue comunicada al ingeniero Rafael Acosta q', 'Erika Natalia Diaz Fitata', 'Sistemas', '2019-08-16'),
