(124, 'Cordial Saludo, se adjunta poster. No pudo ser enviado antes, porque el día de hoy estábamos en visita académica. Y ayer tuvimos problemas para el envío.', 'John Richard Rojas Herrera', 'Industrial', '2019-09-11'),
