INSERT INTO `evaluacion` (`id`, `Id_tesis`, `forprob`, `justificacion`, `objetivos`, `marcoref`, `metodologia`, `crono`, `presupuesto`, `biblio`, `ciber`, `claridad`, `evidencia`, `concepto`, `observaciones`, `jurado`, `fecha_eval`) VALUES
(1, '2', 'OK', 'OK', 'OK', 'OK', 'OK', 'OK', 'OK', 'Solo se hacen citas de pÃ¡ginas web, no se consulta un solo libro, ningÃºn artÃ­culo cientÃ­fico. Ha', 'Se copian y pegan direcciones web, pero no se aplica ninguna norma en cuanto a referenciaciÃ³n para ', 'Varios errores ortograficos en el documento.', 'Poco', 'APROBADO', 'N/A', 'Fredys Simanca', '2020-05-01'),
(270, '', 'sdf', 'df', 'as', 'as', 'as', 'as', 'as', 'as', 'as', 'as', 'as', 'Aprobado con Modificaciones', 'as', 'Fredys Simanca', '2020-11-05'),
(4, '905', 'ok', 'ok', 'ok', 'ok', 'ok', 'no aplica', 'no aplica', 'ok', 'ok', 'Se debe revisar ', 'ok', 'APROBADO', 'Puede continuar con el proceso.', 'Pablo Carreno H', '2018-02-27'),
(264, '', 'bien', 'bien ', 'bien papa', 'bien', 'ok', 'oj', 'evaluacion de prueba', 'ok', 'o', 'k', 'k', 'Aprobado', 'k', 'Fredys Simanca', '2020-10-24'),
(12, '905', 'ok', 'ok', 'ok', 'ok', 'ok', 'no aplica', 'no aplica', 'ok', 'ok', 'revisar', 'ok', 'APROBADO', '', 'Fredys Simanca', '2018-02-27'),
(265, '', 'bien', 'bien ', 'bien papa', 'bien', 'ok', 'oj', 'evaluacion de prueba', 'ok', 'o', 'k', 'k', 'Aprobado', 'k', 'Fredys Simanca', '2020-10-24'),
(16, '955', 'esta bien', 'no cumple', '', '', '', '', '', '', '', '', '', 'APROBADO', '', 'Andres Guarin', '2018-04-25'),
(17, '903', 'ok', 'ok', 'ok', 'ok', 'ok', 'ok', 'ok', 'ok', 'ok', 'ok', 'ok', 'APROBADO', 'Ninguna', 'Pablo Carreno H', '2018-05-02'),
(18, '902', 'El problema está enfocado a definir  buenas prácticas para mitigar el robo de información y el objeto del proyecto es diseño de una guía de pentesting, se tiene que aclarar ¿cuál es la investigación que va a realizar ?', 'Se está hablando de buenas prácticas y el objeto es el diseño de una guía de pentesting ', 'Los objetivos no esta acorde al problema, ni con el titulo, se deben replantear mejor ', 'Complementarlo con  información mas actualizada ', 'No encontré metodología a utilizar', 'No encontré cronograma a utilizar', '', 'Debe mejorar como realiza las citas bibibliogràficas', 'No encontré Cibergrafía a utilizar', 'Están bien, hay que ajustar la coherencia del proyecto respecto a lo que se plantea y el desarrollo  de este .', '', 'El tema es muy interesante, pero debe limitarse un poco mas y enfocar el objetivo a realizar', 'Se debe enfocar el objetivo para que tenga coherencia con el planteamiento del problema y el título del trabajo, igualme', 'Wilfred Torres Ceron', '2018-11-05'),
(65, '1065', 'Es pertinente', 'Se evidencia en el documento', 'Se evidencian en el documento', 'Ok', 'Ok', 'Ok', 'Ok', 'Ok', 'Ok', '', '', 'APROBADO', '', 'Fredys Simanca', '2018-11-06'),
(19, '950', 'Esta bien formulado, ok. ', 'Cumple con lo especificado.', 'En los objetivos específicos, la recolección de información y requerimientos.', 'ok', 'Cumple', 'ok', 'ok', 'Toda la bibliografía se debe utilizar en el documento. tener en cuenta la forma de referenciar completa. (Carreño. P., 2012).', 'Ok, cumple', 'Cumple, aunque no es obligatorio, se debería justificar los textos.', 'Ok', 'APROBADO', 'Puede continuar con el proceso.', 'Pablo Carreno H', '2018-05-03'),
(20, '995', 'No se encuentra un enunciado como tal. En la pagina 8 existen juicios de valor que podrían dejarse de lado para plantear una situación objetiva, sin pretender, como se enuncia, que CloudRoom con Azure solicionará cualquier inconveniente en el market place.', 'En términos generales, se enuncian situaciones y casos donde big data puede funcionar en cuestiones del alumbrado público, donde de manera teórica podría tener beneficios sociales', 'Es claro que se pretende avanzar en el campo de las Smart Cities modelando en tiempo real el tema del alumbrado público', 'Se mencionan algunos casos donde la renovación del  alumbrado público tiene indicadores específicos', 'Hace falta fundamentar mejor la metodología haciendo claridad en la manera como se ejecutaría el proyecto', 'No existe un cronograma como tal, aunque se podría suponer de las conclusiones que el proyecto se llevará a cabo con pruebas en luminarias tipo led y sensores para agregar información. ', 'Se menciona el presupuesto CANDELA, aunque el presupuesto del proyecto no propiamente. Podría pensarse que puede emularse la solución a partir del caso, sería mejor no mencionarlo en Euros', 'Para el caso es pertinente. Podría agregarse algún texto con referencia al Cloud Azure de Microsoft', 'Para el caso es suficiente, aunque podría ajustarse ', 'El texto es legible, sin embargo, podría evitarse redactar en primera persona (pág. 6 y 8)', 'Se mencionan aspectos técnicos y herramientas de big data, data mining y tipos de sensores API', 'Carece de una tabla de contenido, lo que dificulta la lectura, necesario hacer un índice', 'Hace falta un indice que permita navegar con facilidad a traves del documento', 'Pedro A Forero', '2018-05-14'),
(21, '40', 'El problema se plantea con una descripción desde la empresa, la intención y la dificultad en el uso de la estrategia, planteando la necesidad de herramientas ERP y CRM', 'Se expresa desde la necesidad de recurrir a herramientas y fortalecer la toma de decisiones. Es pertinente y  claro en el sentido del fortalecimiento en los procesos de recursos humanos. Se mencionan las problemáticas desde el interior de la organización', 'Los objetivos son claros en las tareas de implementación de las herramientas y la metodología. Los objetivos específicos apuntan al objetivo general y al problema', 'Se elaboraron los marcos, teórico y conceptual, espacial, legal y tecnológico, señalando las herramientas y las tareas que se adelantan en cada uno de ellos con un referente desde lo práctico y lo conceptual', 'El diseño metodológico está conformado por la metodología del desarrollo de software y del tipo de investigación. Se menciona la construcción de software donde se adelantará con resultados tangibles', 'Falta un cronograma como tal, aunque en la metodología y en los resultados propuestos se plantean 3 pasos donde faltaría establecer tiempos para adelantar. ', 'No se menciona explícitamente', 'Existe un buen marco bibliográfico desde el cual el proyecto queda bien sustentado', 'Las fuentes son confiables, accesibles y actualizadas. El marco de referencia es pertinente con la temática y las herramientas propuestas', 'La redacción es sencilla, coherente y cohesiva', 'Se menciona lo que se espera de herramientas como CRM y  ERP utilizando UML para el modelamiento y se relacionan herramientas como HTML y PYTHON para el desarrollo ', 'El trabajo propuesto es aceptable por su coherencia y pertinencia', 'El anteproyecto tiene un sustento referencial importante y su proyección está bien diseñada.', 'Pedro A Forero', '2018-05-15'),
(22, '971', 'No aplica', 'No aplica', 'No aplica', 'No aplica', 'No aplica', 'No aplica', 'No aplica', 'No hay bibliografía, se debe buscar!', 'Es pertinente y actual, pero se debe revisar la confiabilidad', 'Es una Monografía y habla de proyecto, en el resumen habla de nosotros? enfocaremos? quienes, se supone que es un solo autor, hablar en terceras personas. mejorar redacción en todo el documento y conectores de párrafos. Actualizar gráficos ya que son de hace 6 años.', 'Solo hace definiciones de temas, pero no hace las relación entre ellos, que es lo que plantea en el resumen', 'No aprobado', 'Se debe hacer una revisión de conceptos y redacción en todo el documento, utilizar los conectores en cada párrafo, Hacer numeración de gráficos, nombres y fuentes, actualizarlos.', 'Pablo Carreno H', '2018-05-15'),
(23, '974', 'No Aplica', 'No Aplica', 'No Aplica', 'No Aplica', 'No Aplica', 'No Aplica', 'No Aplica', 'No confundir con Cibergrafía ', 'Es pertinente y actual, se debe revisar las fuentes. y verificar es utilizada en el documento', 'Revisar la redacción en todo el documento, utilizar párrafos mas cortos y enlazar con conectores, es un documento técnico no un cuento. Demasiado texto sobrante, de temas que no contribuyen al desarrollo de la monograíia.\r\n', 'Solo recopila temas y definiciones. No evidencia la solución de ningún problema urbano.', 'No Aprobado', 'Debe mejorar redacción, conectores y párrafos, al igual que el documento, las conclusiones son demasiado extensas, sintetizar.', 'Pablo Carreno H', '2018-05-15'),
(24, '972', 'No aplica', 'No aplica', 'No aplica', 'No aplica', 'No aplica', 'No aplica', 'No aplica', 'Se debe separar de cibergrafía.\r\nes pertinente y actual.', 'Cambiar de biblio a ciber. y ubicar donde corresponda.', 'revisar los conectores entre párrafos, no dejar a la deriva el texto anterior.', 'En los gráficos, tener en cuenta el numero, el titulo y la fuente. APA.\r\n', 'APROBADO, con correcciones', 'Corregir las diferentes observaciones', 'Pablo Carreno H', '2018-05-16'),
(25, '978', 'No aplica', 'No aplica', 'No aplica', 'No aplica', 'No aplica', 'No aplica', 'No aplica', 'Ubicar los libros aqui, revisar cibergrafía ', 'Verificar las fuentes', 'Trabajo, Monografía o documento? Numero, titulo, fuente, en los gráficos, tablas, figuras. redaccion en terceras personas, evitar, somos, hacemos...\r\n', 'Si', 'APROBADO, con correcciones', 'Revisar ortografía.', 'Pablo Carreno H', '2018-05-16'),
(26, '986', 'no aplica', 'no aplica', 'no aplica', 'no aplica', 'no aplica', 'no aplica', 'no aplica', 'No realiza ninguna referenciación se limita a colocar texto y no mas', 'no presenta referenciación', 'la redacción entre párrafo no guarda coherencia', 'No se ve la referencia de herramientas propias del diplomado', 'Debe corregir el documento donde se referencie la bibliografia y muestre cual es el aporte desde la parte ingenierial, revisar la redacción', 'Nota: 3.6', 'Fabian Blanco', '2018-05-23'),
