(29, '997', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'No se cumple con la norma de referencia y no se hizo un apartado exclusivo para este aspecto', 'Falta utilizar la norma para éste apartado, no se puede calificar por la forma en que se hizo la referencia.', 'Se puede mejorar la ortografía utilizando un corrector, si bien es cierto que la redacción es sencilla y clara de entender.', 'Utiliza la terminología, especialmente en el desarrollo del proyecto. Puede puntualizar mejor en aspectos particulares del Big Data para evitar que el proyecto quede con ambigüedades.', 'El informe cumple parcialmente, aunque hay modificaciones que se deben hacer especialmente en:\r\n1. Bibliografía\r\n2. Cibergrafía\r\n', 'Pendiente de modificaciones', 'Pedro A Forero', '2018-05-16'),
(30, '983', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'En el texto referencia los conceptos, pero en la bibliográfica no refleja esta referencia, la bibliográfica debe ser fuente primaria.', 'ok', 'ok', 'ok', 'Falta incluir la parte ingenieril por parte del autor y las referencias bibliográficas.', 'Nota: 3.8', 'Fabian Blanco', '2018-05-16'),
