(32, '996', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'La bibliografía es pertinente, está redactada bajo la norma y es actualizada.', 'Tiene Cibergrafía actualizada, completa y coherente con la temática que plantea el proyecto.', 'Existe una buena redacción, la ortografía es buena y existe claridad en el documento.', 'Podría sugerirse un mejor uso de la bibliografía, ya que es abundante puntualizando en alguna herramienta. Ayudan las imágenes (v.gr. Imagen 2, pág. 7) ya que en ellas sí existe el tipo de herramienta de manera explícita.', '4.1 Aprobado. Tener en cuenta: No debe redactarse en primera persona. Falta nombrar algún aspecto de Big Data que sea consecuente con la introducción de la monografía. Esto puede suceder por lo que se identifica en otras partes del trabajo al no centrarse en un solo elemento o herramienta para el an', 'El informe, puede considerarse con buena proyección', 'Pedro A Forero', '2018-05-16'),
(33, '994', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'Utiliza la norma. Se sugiere utilizar el concepto de Referencias que utiliza Word para efectos de elaborar una tabla de bibliografía, de tal forma que los documentos que se citan tengan el formato de libro y no de cita cibergráfica.', 'Es pertinente y puede proyectar la iniciativa que se propone, las fuentes son confiables, igual que en la Bibliografía, podría utilizarse el formato de referencias de Word. En la página 15 y en las gráficas falta utilizar la norma.', 'La redacción es clara. Podría suspenderse un par de expresiones en primera persona (pág. 8)', 'Utiliza conceptos de Big Data y menciona técnicamente elementos relacionados con la temática.', '4.3 APROBADO', 'Existe coherencia con el desarrollo de la monografía, toda vez que se menciona un esquema de desarrollo y se mencionan aspectos descriptivos desde la solución. Se utiliza un diagrama de actividades de alumbrado público en Bogotá, a la par que se señala la aplicación de procesos de análisis de Big Data. Faltó ser explícito en los objetivos para dar una mejor correspondencia con las conclusiones.', 'Pedro A Forero', '2018-05-16'),
(34, '990', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'La bibliografía es correcta aunque escasa. Debe mejorarse el estilo y la norma, ya que es actualizada y pertiente.', 'Corresponde con el apartado de “REFERENCIAS” y aplica a lo sugerido en la sección de Bibliografía.', 'En general, la redacción es buena, se podría mejorar eliminando los juicios de valor y los puntos de vista que resultan objetivos y difíciles de medir.', 'Existen citas de herramientas y, si bien es cierto que falta la referencia, da la impresión de una lectura traducida bien en el texto.', '4.0. aprobado', 'Se utilizan juicios de valor como sentimientos  o alegría, lo que objetivamente resulta difícil de dimensionar y evaluar.\r\nMenciona la importancia de la información en términos de predicciones acertadas y lo que puede significar para la competitividad en las organizaciones, lo que resulta de valor para el desarrollo del proyecto. \r\n', 'Pedro A Forero', '2018-05-16'),
(35, '988', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'Los textos, como tal, no son mencionados. Sí las referencias de Internet.', 'Es suficiente en los aspectos de la pedagogía y la didáctica, y cita 2 sitios donde la tecnología de Big Data tiene que ver con la educación.', 'La redacción es sencilla, tiene buena ortografía y los apartes del documento son coherentes en la temática', 'Se citan herramientas y entidades que las utilizan (pág. 15 y otras).', '4.O APROBADO', 'La temática se dispersa señalando aspectos que desvían los objetivos, se nombran necesidades de formación, métodos de enseñanza, REA y OVA que no concuerdan propiamente con el resumen. REA y OVA son herramientas de apoyo que no se mencionan en le resumen, tampoco hay antecedentes y no se menciona la razón objetiva de la elaboración del documento.', 'Pedro A Forero', '2018-05-16'),
