(63, '1092', 'Se plantea de manera consistente, citando fechas y porcentajes que evidencian la necesidad de abordar el proyecto como alternativa de solución. Se sugiere no redactar en primera persona (Como vemos, los factores ...). La formulación tiene los interrogantes de lo que se aborda como marco temático para el desarrollo del proyecto. Se sugiere revisar la numeración del índice ya que dentro del apartado', 'Desde el planteamiento del problema, se evidencia una justificación acorde con lo que se pretende abordar como alternativa de solución y se plantea la consecuencia de la cantidad de usuarios frente a la aplicabilidad en los diferentes campos', 'Son claros y bien definidos', 'Las fuentes son suficientes y pertinentes', 'Ok', 'Ok', 'Ok', 'Ya que se cuenta con un mayor número de consultas por internet, se sugiere aplicarla como cibergrafía', 'Se sugiere citar las consultas que se incluyeron en la bibliografía como cibergrafía', 'Ok.', 'Ok', 'El documento se encuentra para continuar con el proceso correspondiente', '', 'Pedro A Forero', '2018-10-17'),
