(73, '1104', 'El estudiante contextualiza de manera apropiada el objeto estudio de investigación, define claramente el problema e indica la pregunta o formulación de la misma', 'Si hace énfasis no solo en los porqué a los cuales dará respuesta, sino que define las razones institucionales, sociales , académicas, empresariales y personales que dieron origen a esta investigación', 'Se evidencia los mismos, sin embargo se le indicaron en la sustentación las oportunidades de mejora para establecer en cada fase metodológica las actividades para cumplir los objetivos específicos y dejar claro los entregables que debe mostrar en los resultados esperados.', 'Se le comentó algunas citas y su forma de referenciarlas, sin embargo, el estado del arte da cuenta de profundidad en la búsqueda y referentes de información', 'Si queda clara esta parte, pero se le recomendó hacer énfasis en los aportes desde la ingeniería mecánica y los entregables esperados desde este proyecto de investigación', 'Quedó bien definido en fechas y actividades', 'Debe revisar el aporte del director que es profesor hora cátedra y cambiar el monto del proyecto', 'Debe revisar las formas de referenciar los enlaces web de acuerdo a las normas APA', 'Si es confiable esta parte de la investigación', 'Está bien contextualizado el documento escrito. Debe realizar cambios menores', 'Si se evidencian en forma clara.', 'Queda aprobado con una nota de 4.5 ptos.', '', 'Maria G. Mago R.', '2018-11-28'),
