(125, '1498', 'El estudiante en el anteproyecto define claramente el objeto estudio, así como también el problema de investigación. \r\n\r\nQuedó débil la formulación y no establece la pregunta en el documento, sin embargo, lo hizo de manera clara en la sustentación del anteproyecto.', 'Define claramente los por qués y para qué realiza este estudio, desde el punto de vista académico y empresarial.', 'Si se evidencian las fases de proyecto, hay un diseño metodológico propuesto y el estudiante mostró avances de la fase experimental del proyecto de investigación.', 'La revisión del estado del arte, marco teórico, marco conceptual, legal y normativo es apropiado contextualizando de manera concreta el aporte de la investigación.', 'Si están descritos, tanto en el diseño metodológico como en el de experimentos. Hay avances de los resultados experimentales que el estudiante mostró como evidencia en la sustentación del anteproyecto.', 'Hay un cronograma de actividades definido con fechas y otros establecidos para el proyecto de investigación.', 'El profesor Héctor Fernando Rojas recomendó al estudiante que revisara el presupuesto en los costos del salario mínimo vigente y actualizara el mismo.', 'Tanto los referentes bibliográficos como demás citas son pertinentes y confiables.', 'El estudiante realiza la delimitación correspondiente, así como el nivel de implementación.', 'Hay claridad y coherencia en el discurso escrito.', 'Si se evidencia el uso de herramientas apropiadas', 'Aprobado', 'El proyecto obtiene una calificación de 4,6 ptos.', 'Maria G. Mago R.', '2019-06-10'),
(126, '1469', 'Definen de manera clara tanto el objeto estudio como el problema de investigación, también realiza la pregunta o formulación en el documento escrito.', 'Definen razones empresariales, académicas y otras personales de la línea de investigación en materiales como motivación para realizar este proyecto de opción de grado.', 'Realizan la tabla metodológica e indican el paso a paso de cada fase para alcanzar los objetivos generales.', 'Si las realizan, tanto del estado del arte como del marco conceptual.', 'Si lo explican de manera clara en el documento, sin embargo, el profesor Carlos Bohórquez les hizo recomendaciones a los estudiantes para que fueran más contundente en la contextualización presentada.', 'Desarrollaron el cronograma de actividades, pero no en formato Microsoft Proyect.', 'Indican los recursos y presupuestos que utilizarán en el proyecto de investigación.', 'Si es pertinente, apropiada y confiable la bibliografía presentada en el documento.', 'Si se aplican los items mencionados.', 'Hay coherencia en el documento escrito.', 'Se evidencian herramientas utilizadas para el estudio propuesto,', 'Aprobado', 'Este proyecto tiene una calificación de 4,2 ptos.', 'Maria G. Mago R.', '2019-06-10'),
(127, '1462', 'Realiza de manera clara la descripción del problema de investigación.', 'Justifica las razones empresariales y académicas para realizar este proyecto de investigación.', 'En el documento expone en una tabla metodológica, el paso a paso para alcanzar los objetivos propuestos', 'Si realiza una revisión tanto del estado del arte, como del marco conceptual.', 'Describe de manera clara los métodos e instrumentos a utilizar para validar los resultados propuestos.', 'Realiza un cronograma de actividades de manera apropiado para el desarrollo del proyecto de investigación.', 'En el documento se indica los recursos y el presupuesto previstos para el proyecto de investigación.', 'Se recomienda mejorar la bibliografía presentada.', 'Indica de manera apropiada los items para validar el proyecto de investigación.', 'Hay claridad y coherencia en el documento escrito.', 'Hay evidencia del uso de herramientas propias del plan de estudio.', 'Aprobado', 'El proyecto queda aprobado con 4,0 ptos.', 'Maria G. Mago R.', '2019-06-10'),
