(170, '1588', 'El problema de investigación queda definido claramente, así como también la pregunta de investigación', 'Define de manera clara las razones empresariales, personales, institucionales e incluso las sociales,presentan los aportes desde la Ingeniería Mecánica.', 'Quedan claros los objetivos', 'Se evidencia revisión literaria del estado del arte, marco teórico, conceptual y normativo de manera apropiada.', 'Se mejora la metodología propuesta', 'Se muestra un cronograma de actividades, realizado en Microsoft Proyect como se establece en el documento', 'Se mejora el presupuesto propuesto', 'Esta parte es correcta y pertinente.', 'Si esta, sin embargo, recomiendo revisar el nivel de implementación de la muestra para que quede mejor el desarrollo del documento y del plan de mantenimiento.', 'Hay coherencia y claridad en el texto escrito.', 'Si se evidencian.', 'Aprobado ', 'Fueron realizadas las correcciones y el proyecto que aprobado con una calificación de 4.0 ptos.', 'Maria G. Mago R.', '2019-10-03'),
