(176, '1710', '2.4', '3.0', '4.0', '4', '4.5', '3.0', '3.0', '4', '', '', '', '', 'El cumplimiento de los objetivos planteados no se evidencia en su totalidad en el documento:\nEspecífico 1: Establecer marcos de valoración comparativa para dimensionar la integridad operacional de los protocolos que sustentan la operación de los esquemas lógicos de operación transaccional: SSL (Secure Socket Layer), TLS (Transport Layer Security) y SET (Secure Electronic Transaction). \n\nSería interesante evidenciar dicha valoración, mediante una tabla o algo por el estilo.\nIgual con el específico 2: Construir el referente operacional, que facilite analizar la confiabilidad de los proxy de usuario y de proceso determinados por la arquitectura de seguridad GLOBUS1, para determinar su confiabilidad e integridad. No se encontró en el documento dicho referente operacional para analizar la confiabilidad de los proxy de los usuarios o si está no es evidente para los lectores.\n\nY por último, la metodología propuesta es por fases:\nFase 1. Realización de Evaluaciones de la Seguridad: Consiste en cinco procesos: Entrevistas con los dueños de los procesos; la realización de un inventario de activos; la implementación de un Análisis del Impacto del Negocio (BIA - Bussiness Impact Analysis); la identificación de amenazas sobre el inventario de activos; la implementación de un Análisis de Riesgos (AR - Analysis Risk)\n\nFase 2. Formulación del Diseño de los Objetivos de la Arquitectura de Seguridad: Se fundamentan con la Fase 1, que permitan determinarse en un alto nivel de efectividad los objetivos de la ASI, teniendo en cuenta la definición de la arquitectura lógica y física del sistema de información.\n\nFase 3. Construcción de Políticas y Procedimientos: A partir de las fases previas se concibe una política adecuada para el negocio a través de su conocimiento, esta se estructura teniendo en cuenta el marco de la Política Corporativa, y debe guiar a los usuarios internos y externos como se debe utilizar el sistema de información.\n\nFase 4. Implementación del Diseño de los Objetivos de la Arquitectura de Seguridad: En esta fase se determinan los plazos, la financiación y los recursos necesarios para ejecutar la ASI\n\nFase 5: Integración de las prácticas de seguridad para mantener el estado de seguridad: Se impulsa el mantenimiento de un entorno de trabajo seguro, teniendo en cuenta la aplicación integral de las fases previas, este se divide en dos: a. Gestión de cambios de los elementos o dispositivos que conforman la arquitectura lógica y física. b. Gestión de Proyectos de TI, donde se clarifique la definición de los requisitos y etapas en la ejecución de proyectos que realimenten el estado de la arquitectura o su redefinición.\n\nSi decimos que  el proyecto se llevará a cabo mediante estas fases, están deben ser evidenciadas en el desarrollo del mismo, mencionamos estas fases, pero no se ven tangiblemente a lo largo del documento.\n', 'Fredys Simanca', '2019-08-04'),
