(196, '1805', '5', '4', '6', '12', '7', '3', '6', '7', '3', '3', '7', '7', 'Existe observaciones para el problema, el título, los objetivos y las conclusiones.\nSe evaluó con respecto a los contenidos de la rúbrica.\nEl título tiene “SAB BUSINESS”, en las conclusiones está “SAP Business”.\nEl problema enuncia situaciones de demora, en el objetivo general se plantea “pérdida de información”.\nMenciona los pasos, mas no la técnica.\nFalta claridad en el gráfico (Nombres y años en los ejes).\nSe utilizan juicios de valor.\n', 'Pedro A Forero', '2019-09-03'),
(197, '1796', '5', '4', '7', '12', '8', '4', '7', '8', '3', '3', '7', '8', 'Se evaluó con respecto a los contenidos de la rúbrica\nConclusiones: se comenta del módulo MM sin darle la relevancia en los ítems del problema y de objetivos.\n\n\n\nEl problema está planteado de manera genérica sin puntualizar en un área determinada.\nEl problema enuncia situaciones de demora, en el objetivo general se plantea “pérdida de información”\n\nMenciona los pasos, mas no la técnica\nLos objetivos se plantean desde la “identificación” de procesos, lo cual no se encuentra claro en alguno de los items de resultados\nSe utilizan juicios de valor\n', 'Pedro A Forero', '2019-09-03'),
(198, '1775', '5', '4', '8', '15', '10', '4', '8', '9', '5', '4', '8', '8', 'El objetivo es puntual, aunque la descripción del problema es mucho más amplia\nSe evaluó con respecto a los contenidos de la rúbrica\nIntroducción:El aspecto de “bienestar” de los trabajadores no se incluye en la problemática\nLos resultados denotan una mayor amplitud de trabajo con respecto a los objetivos.\n', 'Pedro A Forero', '2019-09-03'),
(199, '1751', '5', '4', '7', '9', '7', '4', '7', '9', '4', '3', '6', '7', 'Se evaluó con respecto a los contenidos de la rúbrica\nFormato del poster: Su pesentación se desvirtúa por el orden en el cual se encuentran los “pantallazos” de inventario\nEn la Introdcción se comenta de sap y no se define de manera clara la relación que tiene con la compañía de telecomunicaciones\nEl planteamiento del problema tiene multiplicidad de variables, es necesario puntualizar en la situación crítica.\nNo se encuentran los pasos de la metodología\nSe comenta sobre el manejo que se dio a los datos, sin embargo no se puntualiza y por lo tanto, no se puede confrontar con el objetivo\nEn las conclusiones existen juicios de valor: “potencialmente”, “a gusto”.\nLa bibliografía carece de la norma para relacionarla.', 'Pedro A Forero', '2019-09-03'),
