(217, '1720', 'En la formulación de la pregunta problema sustituir o eliminar la palabra Brindar.', 'Justificar por que solo se van a realizar las estrategias en el proceso de pintura. Para mi no tiene alcance de trabajo de grado, por eso los invito a justificar  de manera robusta o incluir los demás procesos.', 'ok', 'ok, pero podrían realizar un marco mas amplio para tener suficiente base teórica para la metodología.', 'Incluir el como o basado en que autor se realizaran las herramientas, ejemplo  eco mapa eco balance, describir detalladamente el metodo', 'ok', 'ok', 'ok', 'Por favor justificar mas robustamente por que solo el proceso de pintura, o evaluar ampliar el alcance.', 'ok', 'ok', 'Aplazado', 'Corregir Observaciones para dar aprobación final al trabajo.', 'Lida E. Ruiz M.', '2019-09-10'),
